import * as Paperless from '@zone09.net/paperless';
import * as HaC from '@zone09.net/hac';
import * as Addons from '../../app.brained/src/app.brained/ui/UI.js'



let context: Paperless.Context = new Paperless.Context({autosize: true});
let group: Paperless.Group = new Paperless.Group();

let puzzled1: HaC.Components.Puzzled = new HaC.Components.Puzzled(new Paperless.Point(16, 16), new Paperless.Size((window.innerWidth / 2) - 16, window.innerHeight - 16),{
	hop: 64, 
	expandable: false,
	nofill: false,
	nostroke: false,
	linewidth: 2,
	spacing: 5,
	shadow: 5,
	alpha: 0.1,
	color: {
		fill: '#000000',
		stroke: '#666666',
		//marked: '#ddbb44',
		move: '#9047a4',
		nomove: '#ff0000',
		sizer: '#666666',
		splitter: '#ffffff',
		highlight: '#ffffff',
		faked: '#151515',
	}
});

let puzzled2: HaC.Components.Puzzled = new HaC.Components.Puzzled(new Paperless.Point((window.innerWidth / 2) + 16, 16), new Paperless.Size((window.innerWidth / 2) - 16, 500), {
	hop: 64, 
	expandable: true,
	nofill: false,
	nostroke: false,
	linewidth: 10,
	spacing: 5,
	shadow: 5,
	alpha: 0.1,
})

context.attach(document.body);
context.attach(puzzled1);
context.attach(puzzled2);
context.attach(group);

group.attach([puzzled1, puzzled2]);


puzzled1.new([
	// blank/blank
	{
		size: new Paperless.Size(128, 128),
		control: HaC.Controls.Puzzled.EntityCoreControl,
		drawable: HaC.Drawables.Puzzled.EntityCoreDrawable,
	},

	
	// static/void
	{
		size: new Paperless.Size(128, 128),
		control: Addons.Controls.Static,
		drawable: Addons.Drawables.Void,
	},

	// static/artwork
	{
		size: new Paperless.Size(128, 128),
		control: Addons.Controls.Static,
		drawable: Addons.Drawables.Artwork,
		attributes: {
			fillcolor: '#ffffff',
			artwork:
			{
				padding: 5,
				content: 'data:image/png;base64,'
			}
		}
	},

	// static/label
	{
		size: new Paperless.Size(128, 128),
		control: Addons.Controls.Static,
		drawable: Addons.Drawables.Label,
		attributes: {
			label: {
				content: 'This is a label made by Paperless itself and gently rendering to your screen.',
			}
		},
	},

	// texmage/texmage
	{
		size: new Paperless.Size(128, 128),
		control: Addons.Controls.Texmage,
		drawable: Addons.Drawables.Texmage,
		attributes: {
			type: 'label',
			label: {
				content: 'This is a label made by Paperless itself and gently rendering to your screen.',
			},
			artwork: {
				content: 'data:image/png;base64,',
			}
		}
	},

	// separator/separator
	{
		size: new Paperless.Size(128, 128),
		control: Addons.Controls.Separator,
		drawable: Addons.Drawables.Separator,
		attributes: {
			line: {
				strokecolor: '#436665',
			}
		},
	},
	
	// drawio/drawio
	{
		size: new Paperless.Size(128, 128),
		control: Addons.Controls.Drawio,
		drawable: Addons.Drawables.Drawio,
		attributes: {
			artwork: {
				content: 'data:image/png;base64,',
			}
		}
	},

	// editable/editable
	{
		size: new Paperless.Size(128, 128),
		control: Addons.Controls.Editable,
		drawable: Addons.Drawables.Editable,
		attributes: {
			label: {
				content: 'Edit me! .......',
				font: '14px CPMono-v07-Light'
			},
			cursor: {
				blink: false,
				width: 9,
				alpha: 0.5
			}
		}
	},

	// empty/empty
	{
		size: new Paperless.Size(128, 128),
		control: Addons.Controls.Empty,
		drawable: Addons.Drawables.Empty,
		attributes: {
			nofill: true,
			nostroke: true,
			line: {
				strokecolor: '#436665'
			},
			rectangle: {
				strokecolor: '#436665',
				nofill: true
			}
		}
	},
		
	// field/field
	{
		size: new Paperless.Size(384, 128),
		control: Addons.Controls.Field,
		drawable: Addons.Drawables.Field,
		attributes: {
			leftwidth: 60,
			rightwidth: 28,
			label: {
				content: 'Notes',
				multiline: true,
				padding: {top: 6, left: 5},
				fillcolor: '#151515',
				font: '14px CPMono-v07-Bold',
				fillbackground: '#815556',
			},
			editable: {
				label: {
					padding: {top: 6, left: 5},
					font: '14px CPMono-v07-Light',
					multiline: true,
					wrapping: true
				},
				cursor: {
					width: 9,
					fillcolor: '#436665',
					blink: false,
					alpha: 0.7
				}
			},
			artwork: {
				//content: this.selector.datacenter.root.assets.misc.close,
				shadowcolor: '#151515'
			},
			rectangle: {
				fillcolor: '#815556'
			}
		},
	},
]);


let control = puzzled2.new([
	{
		size: new Paperless.Size(128, 128),
		control: HaC.Controls.Puzzled.EntityCoreControl,
		drawable: HaC.Drawables.Puzzled.EntityCoreDrawable,
	},
]);




